/**
 * Editor Spec
 */
function createDocument(): BodyWidget {
    let section: BodyWidget = new BodyWidget();
    section.index = 0;
    section.sectionFormat = new WSectionFormat(section);
    let paragraph: ParagraphWidget = new ParagraphWidget();
    paragraph.index = 0;
    paragraph.paragraphFormat = new WParagraphFormat(paragraph);
    paragraph.characterFormat = new WCharacterFormat(paragraph);
    let line: LineWidget = new LineWidget(paragraph);
    let element: TextElementBox = new TextElementBox();
    element.text = 'Adventure Works Cycles';
    line.children.push(element);
    element.line = line;
    section.childWidgets.push(paragraph);
    paragraph.containerWidget = section;
    paragraph.childWidgets.push(line);
    return section;
}
/**
 * Editor Spec
 */
function createDocumentHyperlink(): BodyWidget {
    let section: BodyWidget = new BodyWidget();
    section.index = 0;
    section.sectionFormat = new WSectionFormat(section);
    let paragraph: ParagraphWidget = new ParagraphWidget();
    paragraph.index = 0;
    paragraph.paragraphFormat = new WParagraphFormat(paragraph);
    paragraph.characterFormat = new WCharacterFormat(paragraph);
    let line: LineWidget = new LineWidget(paragraph);
    let fieldBegin: FieldElementBox = new FieldElementBox(0);
    let code: TextElementBox = new TextElementBox();
    code.text = ' HYPERLINK https://syncfusion.com';
    let separator: FieldElementBox = new FieldElementBox(2);
    let element: TextElementBox = new TextElementBox();
    element.text = 'Adventure Works Cycles';
    let end: FieldElementBox = new FieldElementBox(1);
    end.fieldSeparator = separator;
    end.fieldBegin = fieldBegin;
    separator.fieldBegin = fieldBegin;
    separator.fieldEnd = end;
    fieldBegin.fieldSeparator = separator;
    fieldBegin.fieldEnd = end;
    line.children.push(fieldBegin);
    fieldBegin.line = line;
    line.children.push(code);
    code.line = line;
    line.children.push(separator);
    separator.line = line;
    line.children.push(element);
    element.line = line;
    line.children.push(end);
    end.line = line;
    section.childWidgets.push(paragraph);
    paragraph.containerWidget = section;
    paragraph.childWidgets.push(line);
    return section;
}
